import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
    const navigate = useNavigate();
    const [showForm, setShowForm] = useState(false);
    const [formData, setFormData] = useState({
        fullName: '',
        tournamentName: '',
        tournamentDate: '',
        auctionDate: '',
        email: ''
    });

    // Get the user role and email from local storage
    const userRole = localStorage.getItem('role');
    const userEmail = localStorage.getItem('userEmail');

    // Handle logout
    const handleLogout = () => {
        localStorage.removeItem('userEmail');
        localStorage.removeItem('role');
        navigate('/');
    };

    // Handle scrolling to the sections
    const scrollToSection = (sectionId) => {
        const section = document.getElementById(sectionId);
        if (section) {
            section.scrollIntoView({ behavior: 'smooth' });
        }
    };

    // Toggle form visibility
    const toggleForm = () => {
        setShowForm(!showForm);
    };

    // Handle form input changes
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({ ...prevData, [name]: value }));
    };

    // Handle form submission
    const handleFormSubmit = (e) => {
        e.preventDefault();
        // Here you would typically send the formData to your backend or API to request role change
        console.log("Requesting role change with data:", formData);
        alert("Request sent to admin for role change to leader.");
        setShowForm(false); // Hide form after submission
    };

    return (
        <header className="navbar">
            <h2 className="logo">CrickBidders</h2>
            <nav className="nav-links">
                <Link to="/" className="nav-link">Home</Link>

                {(userRole === 'leader' || userRole === 'admin') && (
                    <Link to="/leader-dashboard" className="nav-link">Leader</Link>
                )}

                {userRole === 'admin' && (
                    <Link to="/admin-dashboard" className="nav-link">Admin</Link>
                )}

                {userRole === 'viewer' && (
                    <button onClick={toggleForm} className="nav-link">Create New</button>
                )}

                {userEmail && userRole ? (
                    <button onClick={handleLogout} className="nav-link logout-button">Logout</button>
                ) : (
                    <Link to="/login" className="nav-link">Log In</Link>
                )}

                <button onClick={() => scrollToSection('about')} className="nav-link">About</button>
                <button onClick={() => scrollToSection('how-to-use')} className="nav-link">How</button>
                <button onClick={() => scrollToSection('contact')} className="nav-link">Contact Us</button>
            </nav>

            {/* Show form if showForm is true */}
            {showForm && (
                <div className="form-container">
                    <form onSubmit={handleFormSubmit} className="role-request-form">
                        <h3>Request Role Change to Leader</h3>
                        <label>
                            Full Name:
                            <input
                                type="text"
                                name="fullName"
                                value={formData.fullName}
                                onChange={handleInputChange}
                                required
                            />
                        </label>
                        <label>
                            Tournament Name:
                            <input
                                type="text"
                                name="tournamentName"
                                value={formData.tournamentName}
                                onChange={handleInputChange}
                                required
                            />
                        </label>
                        <label>
                            Tournament Date:
                            <input
                                type="date"
                                name="tournamentDate"
                                value={formData.tournamentDate}
                                onChange={handleInputChange}
                                required
                            />
                        </label>
                        <label>
                            Auction Date:
                            <input
                                type="date"
                                name="auctionDate"
                                value={formData.auctionDate}
                                onChange={handleInputChange}
                                required
                            />
                        </label>
                        <label>
                            Email Address:
                            <input
                                type="email"
                                name="email"
                                value={formData.email}
                                onChange={handleInputChange}
                                required
                            />
                        </label>
                        <button type="submit" className="submit-button">Submit Request</button>
                    </form>
                </div>
            )}
        </header>
    );
};

export default Navbar;
